         src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.behance.net%2Fgallery%2F33842168%2FAmazon-Web-Banners&psig=AOvVaw1BkGgbvI0l6MQ3IFscPVps&ust=1663841281174000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCNihufbRpfoCFQAAAAAdAAAAABAE" alt=""
         />
       </div>
    </div>
  );
}

export default Home;
